        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlin (12px [bɛɐ̯ˈliːn]?/i) ist die Hauptstadt und zugleich ein Land der Bundesrepublik Deutschland. Der Stadtstaat Berlin bildet eine Einheitsgemeinde und ist mit über 3,4 Millionen Einwohnern die bevölkerungsreichste und mit knapp 892 Quadratkilometern die flächengrößte Kommune Deutschlands sowie nach Einwohnern die zweitgrößte der Europäischen Union. Zudem ist Berlin mit rund 3800 Einwohnern je Quadratkilometer die am drittdichtesten bevölkerte Gemeinde Deutschlands."@de .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlino (in tedesco Berlin [bɛɐˈliːn], ) è la maggiore città e nel contempo un Bundesland della Germania, quindi una città-stato. Capitale federale della Repubblica Federale di Germania e sede del suo governo, è uno dei più importanti centri politici, culturali, scientifici, fieristici e mediatici d'Europa e, dopo Londra, il secondo comune più popoloso dell'Unione europea, con 3.419.623 abitanti."@it .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlim (em alemão Berlin) é a capital e um dos dezesseis estados da Alemanha. Com uma população de 3,5 milhões dentro de limites da cidade, é a maior cidade do país, além de ser a segunda mais populosa cidade e a sétima área urbana mais populosa da União Europeia. Situada no nordeste da Alemanha, é o centro da área metropolitana de Berlim-Brandemburgo, que inclui 5 milhões de pessoas de mais de 190 nações."@pt .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlin (/bərˈlɪn/, German: [bɛɐ̯ˈliːn] (13px )) is the capital of Germany, and one of the 16 states of Germany. With a population of 3.5 million people, Berlin is Germany's largest city. It is the second most populous city proper and the seventh most populous urban area in the European Union. Located in northeastern Germany on the banks of River Spree, it is the center of the Berlin-Brandenburg Metropolitan Region, which has about 4.5 million residents from over 180 nations."@en .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "柏林（德语：Berlin，德语发音：[bɛɐ̯ˈliːn]（13px 发音））是德国首都，也是德国最大的城市，现有居民约340万人。柏林位于德国东北部，四面被勃兰登堡州环绕，施普雷河和哈弗尔河流经该市。柏林也是德国十六个联邦州之一，和汉堡、不来梅同为德国僅有的三個的城市州。柏林是欧盟區內人口第3多的城市（歐盟區人口最多的都市是法國的巴黎，其次是英國的倫敦）以及城市面积第8大的城市。它是柏林－勃兰登堡都会区的中心，有来自超过190个国家的5百万人口。地理上位于欧洲平原，受温带季节性气候影响。城市周围三分之一的土地由森林、公园、花园、河流和湖泊组成。该市第一次有文字记载是在13世纪，柏林连续的成为以下这些国家的首都：普鲁士王国（1701年－1870年）、德意志帝国（1871年－1918年）、魏玛共和国（1919年－1933年）、納粹德國（1933年－1945年）。在1920年代，柏林是世界第3大自治市。第二次世界大战后，城市被分割；东柏林成为了东德的首都，而西柏林事实上成为了西德在东德的一块飛地，被柏林墙围住。直到1990年两德统一，该市重新获得了全德国首都的地位，驻有147个外国大使馆。柏林无论是从文化、政治、传媒还是科学上讲都称的上是世界级城市。该市经济主要基于服务业，包括多种多样的创造性产业、传媒集团、议会举办地点。柏林扮演了一个欧洲大陆上航空与铁路运输交通枢纽的角色，同时它也是欧盟内游客数量最多的城市之一。主要的产业包括信息技术、制药、生物工程、生物科技、光学电子、交通工程和可再生能源。柏林都会区有知名大学、研究院、体育赛事、管弦乐队、博物馆和知名人士。城市的历史遗存使该市成为国际电影产品的交流中心。该市在节日活动、建筑的多样化、夜生活、当代艺术、公共交通网络以及高质量生活方面得到了广泛认可。柏林已经发展成一个全球焦点城市，以崇尚自由生活方式和现代精神的年轻人和艺术家而闻名。"@zh .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Берли́н (нем. Berlin [bɛɐ̯ˈliːn]) — столица Германии, самый крупный и самый населённый город Германии. Берлин — второй по населению (после Лондона) и пятый по площади город Евросоюза.Берлин — одна из 16 земель в составе ФРГ."@ru .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlin – stolica, siedziba rządu Republiki Federalnej Niemiec. Największe miasto Niemiec, na prawach kraju związkowego. Zajmuje powierzchnię ok. 892 km², zamieszkuje je 3,4 mln osób. Jest trzecim największym (po Londynie i Paryżu) miastem w Unii Europejskiej.Berlin jest podzielony na dwanaście okręgów administracyjnych (Bezirk). Przez przestrzeń miejską przepływają m.in."@pl .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlin (prononcé [bɛʁ.lɛ̃ ] ; en allemand Berlin [bɛɐ̯.ˈliːn ] ) est la capitale et la plus grande ville d'Allemagne. Située dans le nord-est du pays, elle forme un land (État fédéré) à part entière et compte environ 3,5 millions d'habitants. Ses habitants s'appellent les Berlinois. Berlin est la deuxième ville, la cinquième agglomération et la cinquième zone urbaine élargie (après la région allemande de la Ruhr) la plus peuplée de l'Union européenne."@fr .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "برلين (بالألمانية: Berlin برلين) هي عاصمة جمهورية ألمانيا الاتحادية، وإحدى ولايات ألمانيا الست عشرة، كما أنها أكبر مدن ألمانيا من حيث عدد السكان. وتعتبر برلين إحدى \"الولايات المدن\" الثلاث بجمهورية ألمانيا الاتحادية (إلى جانب بريمن وهامبورغ)، وتأتي هذه التسمية من كون حدود المدينة هي نفسها حدود الولاية. وبرلين هي أيضاً ثاني أكبر مدن الاتحاد الأوروبي بعد العاصمة البريطانية لندن.وخلال فترةالحرب الباردة وتحديداً في عام 1961، قامت حكومة ألمانيا الشرقية بتشييد ما كان يعرف بـجدار برلين."@ar .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlín (Berlin en alemán (Acerca de este sonido [bɛɐ̯ˈliːn] )) es la capital de Alemania y uno de los dieciséis estados federados alemanes. Se localiza al noreste de Alemania, a escasos 70 km de la frontera con Polonia. Por la ciudad fluyen los ríos Spree, Havel, Panke, Dahme y Wuhle."@es .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "Berlijn (Duits: Berlin) is de hoofdstad van Duitsland en als stadstaat een deelstaat van dat land. Met 3.375.222 inwoners is Berlijn tevens de grootste stad van het land en de op één na grootste stad in de Europese Unie."@nl .
        <http://dbpedia.org/resource/Berlin> <http://www.w3.org/2000/01/rdf-schema#comment> "ベルリン（独: Berlin ドイツ語発音: [bɛɐ̯ˈliːn] (13px 聞く)）は、ドイツの都市で同国の首都である。16ある連邦州のうちの一つで、市域人口は340万人とドイツでは最大の都市で欧州連合の市域人口ではロンドンに次いで2番目に多く、都市的地域の人口は7番目に多い。"@ja .
