        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "برلين (بالألمانية: Berlin برلين) هي عاصمة جمهورية ألمانيا الاتحادية، وإحدى ولايات ألمانيا الست عشرة، كما أنها أكبر مدن ألمانيا من حيث عدد السكان. وتعتبر برلين إحدى \"الولايات المدن\" الثلاث بجمهورية ألمانيا الاتحادية (إلى جانب بريمن وهامبورغ)، وتأتي هذه التسمية من كون حدود المدينة هي نفسها حدود الولاية. وبرلين هي أيضاً ثاني أكبر مدن الاتحاد الأوروبي بعد العاصمة البريطانية لندن.وخلال فترةالحرب الباردة وتحديداً في عام 1961، قامت حكومة ألمانيا الشرقية بتشييد ما كان يعرف بـجدار برلين. هكذا أصبحت برلين مدينة مُقسمة إلى جزئين: جزء غربي يتبع ألمانيا الغربية والآخر شرقي يتبع ألمانيا الشرقية. وبقي الحال في برلين على هذا النحو إلى حين سقوط الجدار في عام 1989 وتوحيد الألمانيتين في عام 1990، واختيرت برلين بعدها عاصمة جمهورية ألمانيا الاتحادية ومركز حكومتها والبرلمان، وإحدى أهم المدن الأوروبية."@ar .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Берли́н (нем. Berlin [bɛɐ̯ˈliːn]) — столица Германии, самый крупный и самый населённый город Германии. Берлин — второй по населению (после Лондона) и пятый по площади город Евросоюза.Берлин — одна из 16 земель в составе ФРГ. Город расположен на берегах рек Шпрее, в связи с чем Берлин называют «Афинами на Шпрее», и Хафель в центре федеральной земли Бранденбург, частью которой он не является с 1920 года.Около 1200 года на месте современного Берлина располагались два торговых поселения — Кёльн и Берлин. Точная дата получения ими городских прав неизвестна. Городские права Кёльна впервые упоминаются в 1237 году, городские права Берлина — в 1244 году. В 1307 году города объединились и образовали общую городскую управу. В 1400 году население объединённого Берлина составляло 8000 человек. Историческое название «Кёльн» нашло своё отражение в названии берлинского района Нойкёльн.Берлин был столицей маркграфства/курфюршества Бранденбургского (с 1417 года), Пруссии (после объединения курфюршества Бранденбург с герцогством Пруссия) и после создания Германской империи стал её столицей.После Второй мировой войны в соответствии с решениями Ялтинской конференции Берлин, хоть и находился на территории советской зоны оккупации Германии, был разделён четырьмя державами-победительницами на оккупационные секторы. Позднее три сектора оккупации союзников были преобразованы в Западный Берлин, получивший статус особого государственного образования, но безусловно тесно связанного с ФРГ. Передвижение между секторами Берлина длительное время оставалось относительно свободным, и в целях предотвращения утечки населения в западные секторы правительством ГДР было принято решение о возведении Берлинской стены, окружившей с 13 августа 1961 года Западный Берлин. Берлинская стена, ставшая одним из главных символов холодной войны, просуществовала до 1989 года. После объединения Германии в 1990 году её столицей стал воссоединённый Берлин. В 1994 году туда переехала из Бонна администрация президента и в 1999 году — Германский бундестаг и администрация федерального канцлера вместе с федеральными министерствами.Сегодня Берлин является мировым культурным центром. Это крупный европейский транспортный узел и один из самых посещаемых городов на континенте. Университеты, исследовательские институты и музеи Берлина известны во всем мире. В городе живут и работают художники, дипломаты и иммигранты со всех уголков планеты."@ru .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlín (Berlin en alemán (Acerca de este sonido [bɛɐ̯ˈliːn] )) es la capital de Alemania y uno de los dieciséis estados federados alemanes. Se localiza al noreste de Alemania, a escasos 70 km de la frontera con Polonia. Por la ciudad fluyen los ríos Spree, Havel, Panke, Dahme y Wuhle. Con una población de 3,4 millones de habitantes, Berlín es la ciudad más poblada del país, así como la segunda ciudad en tamaño y la quinta aglomeración urbana entre los países de la Unión Europea.Fundada en 1237 como Cölln, Berlín fue sucesivamente capital del Reino de Prusia (1701-1918), de la República de Weimar (1919–1933) y del Tercer Reich (1933–1945). Después de la Segunda Guerra Mundial, la ciudad fue dividida; la parte este de la ciudad se convirtió en la capital de la República Democrática Alemana, mientras que la región oeste de la ciudad se convirtió en un enclave de la República Federal de Alemania en el interior de la Alemania Oriental.Berlín es una ciudad mundial y un centro cultural y artístico de primer nivel. Es una de las ciudades más influyentes en el ámbito político de la Unión Europea y en 2006 fue elegida Ciudad Creativa por la Unesco. En 2009 la ciudad recibió el Premio Príncipe de Asturias de la Concordia."@es .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlijn (Duits: Berlin) is de hoofdstad van Duitsland en als stadstaat een deelstaat van dat land. Met 3.375.222 inwoners is Berlijn tevens de grootste stad van het land en de op één na grootste stad in de Europese Unie. De stad ligt in het noordoosten van Duitsland, aan de rivier de Spree en wordt omsloten door de deelstaat Brandenburg, waarvan ze sinds 1920 geen deel meer uitmaakt.In zijn geschiedenis, die teruggaat tot de dertiende eeuw, was Berlijn de hoofdstad van Pruisen (1701–1918), het Duitse Keizerrijk (1871–1918), de Weimarrepubliek (1919–1933) en nazi-Duitsland (1933–1945). Na de Tweede Wereldoorlog was Berlijn gedurende meer dan veertig jaar een verdeelde stad, waarbij het oostelijke deel als hoofdstad fungeerde van de Duitse Democratische Republiek en West-Berlijn een de facto exclave van West-Duitsland was. Na de Duitse hereniging in 1990 werd Berlijn de hoofdstad van de Bondsrepubliek Duitsland en de zetel van het parlement, de deelstaatvertegenwoordiging en het staatshoofd.Berlijn is een metropool en geldt in Europa als een van de grootste culturele, politieke en wetenschappelijke centra. De stad is ook bekend vanwege het hoog-ontwikkelde culturele leven (festivals, nachtleven, musea, kunsttentoonstellingen enz.) en de liberale levensstijl, moderne Zeitgeist en de lage kosten. Bovendien is Berlijn een van de groenste steden van Europa: 22% van Berlijn bestaat uit natuur en parken en 6% uit meren, rivieren en kanalen."@nl .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlino (in tedesco Berlin [bɛɐˈliːn], ) è la maggiore città e nel contempo un Bundesland della Germania, quindi una città-stato. Capitale federale della Repubblica Federale di Germania e sede del suo governo, è uno dei più importanti centri politici, culturali, scientifici, fieristici e mediatici d'Europa e, dopo Londra, il secondo comune più popoloso dell'Unione europea, con 3.419.623 abitanti. La regione metropolitana Berlino/Brandeburgo ha una superficie di 30.370 km² ed una popolazione (2012) di 6.024.000 abitanti."@it .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (12px [bɛɐ̯ˈliːn]?/i) ist die Hauptstadt und zugleich ein Land der Bundesrepublik Deutschland. Der Stadtstaat Berlin bildet eine Einheitsgemeinde und ist mit über 3,4 Millionen Einwohnern die bevölkerungsreichste und mit knapp 892 Quadratkilometern die flächengrößte Kommune Deutschlands sowie nach Einwohnern die zweitgrößte der Europäischen Union. Zudem ist Berlin mit rund 3800 Einwohnern je Quadratkilometer die am drittdichtesten bevölkerte Gemeinde Deutschlands. Berlin ist eine Enklave im Land Brandenburg und bildet das Zentrum der Metropolregion Berlin/Brandenburg (6 Millionen Einwohner) sowie der Agglomeration Berlin (4,4 Millionen Einwohner). Der Stadtstaat unterteilt sich in zwölf Bezirke. Neben den Flüssen Spree, Havel und Dahme befinden sich im Stadtgebiet kleinere Fließgewässer sowie zahlreiche Seen und Wälder.Erstmals 1237 urkundlich erwähnt, war Berlin im Verlauf der Geschichte und in verschiedenen Staatsformen Residenz- und Hauptstadt Brandenburgs, Preußens und des Deutschen Reichs. Ab 1949 war der Ostteil der Stadt faktisch Hauptstadt der Deutschen Demokratischen Republik. Mit der deutschen Wiedervereinigung im Jahr 1990 war Berlin wieder gesamtdeutsche Hauptstadt und wurde in der Folge Sitz der Bundesregierung, des Bundespräsidenten, des Deutschen Bundestags, des Bundesrats sowie zahlreicher Bundesministerien und Botschaften.Berlin ist ein bedeutender europäischer Verkehrsknotenpunkt und eines der meistbesuchten Zentren des Kontinents. Die Sportereignisse, Universitäten, Forschungseinrichtungen und Museen Berlins genießen internationalen Ruf. In der Stadt leben Firmengründer, Künstler und Einwanderer aus aller Welt. Berlins Architektur, Festivals, Nachtleben und vielfältige Lebensbedingungen sind weltweit bekannt."@de .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "ベルリン（独: Berlin ドイツ語発音: [bɛɐ̯ˈliːn] (13px 聞く)）は、ドイツの都市で同国の首都である。16ある連邦州のうちの一つで、市域人口は340万人とドイツでは最大の都市で欧州連合の市域人口ではロンドンに次いで2番目に多く、都市的地域の人口は7番目に多い。"@ja .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (/bərˈlɪn/, German: [bɛɐ̯ˈliːn] (13px )) is the capital of Germany, and one of the 16 states of Germany. With a population of 3.5 million people, Berlin is Germany's largest city. It is the second most populous city proper and the seventh most populous urban area in the European Union. Located in northeastern Germany on the banks of River Spree, it is the center of the Berlin-Brandenburg Metropolitan Region, which has about 4.5 million residents from over 180 nations. Due to its location in the European Plain, Berlin is influenced by a temperate seasonal climate. Around one third of the city's area is composed of forests, parks, gardens, rivers and lakes.First documented in the 13th century, Berlin became the capital of the Margraviate of Brandenburg (1417), the Kingdom of Prussia (1701–1918), the German Empire (1871–1918), the Weimar Republic (1919–1933) and the Third Reich (1933–1945). Berlin in the 1920s was the third largest municipality in the world. After World War II, the city was divided; East Berlin became the capital of East Germany while West Berlin became a de facto West German exclave, surrounded by the Berlin Wall (1961–1989). Following German reunification in 1990, the city was once more designated as the capital of all Germany, hosting 158 foreign embassies.Berlin is a world city of culture, politics, media, and science. Its economy is based on high-tech firms and the service sector, encompassing a diverse range of creative industries, research facilities, media corporations, and convention venues. Berlin serves as a continental hub for air and rail traffic and has a highly complex public transportation network. The metropolis is a popular tourist destination. Significant industries also include IT, pharmaceuticals, biomedical engineering, clean tech, biotechnology, construction, and electronics.Modern Berlin is home to renowned universities, orchestras, museums, entertainment venues, and is host to many sporting events. Its urban setting has made it a sought-after location for international film productions. The city is well known for its festivals, diverse architecture, nightlife, contemporary arts, and a high quality of living. Over the last decade Berlin has seen the upcoming of a cosmopolitan entrepreneurial scene."@en .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (prononcé [bɛʁ.lɛ̃ ] ; en allemand Berlin [bɛɐ̯.ˈliːn ] ) est la capitale et la plus grande ville d'Allemagne. Située dans le nord-est du pays, elle forme un land (État fédéré) à part entière et compte environ 3,5 millions d'habitants. Ses habitants s'appellent les Berlinois. Berlin est la deuxième ville, la cinquième agglomération et la cinquième zone urbaine élargie (après la région allemande de la Ruhr) la plus peuplée de l'Union européenne. Son agglomération s'étend sur 2 284 km2 et compte un peu plus de 4 millions d'habitants, sa zone urbaine élargie 5 025 272 habitants et son aire urbaine qui cumule les Länder de Berlin et de Brandebourg regroupe au total près de 6 millions d'habitants. Fondée au XIIIe siècle, Berlin a été successivement capitale du royaume de Prusse (1701-1871), de l'Empire allemand (1871-1918), de la République de Weimar (1919-1933) et du Troisième Reich (1933-1945). Après 1945 et jusqu'à la chute du Mur de Berlin en 1989, la ville est partagée en quatre secteurs d'occupation. Pendant la Guerre froide, le secteur soviétique de la ville, nommé Berlin-Est, est devenu la capitale de la République démocratique allemande, tandis que Berlin-Ouest était politiquement rattachée à la République fédérale d'Allemagne, devenant ainsi un bastion avancé du « Monde libre » à l'intérieur du Bloc communiste. Après la chute du mur, Berlin redevint, en 1990, la capitale de l'Allemagne alors réunifiée, et les principales institutions fédérales y emménagèrent en 1999.Berlin est une ville mondiale culturelle et artistique de premier plan. La ville abrite 166 musées, 142 bibliothèques et 60 théâtres. En 2012, Berlin a accueilli plus de 10,8 millions de visiteurs."@fr .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlim (em alemão Berlin) é a capital e um dos dezesseis estados da Alemanha. Com uma população de 3,5 milhões dentro de limites da cidade, é a maior cidade do país, além de ser a segunda mais populosa cidade e a sétima área urbana mais populosa da União Europeia. Situada no nordeste da Alemanha, é o centro da área metropolitana de Berlim-Brandemburgo, que inclui 5 milhões de pessoas de mais de 190 nações. Localizada na grande planície europeia, Berlim é influenciada por um clima temperado sazonal. Cerca de um terço da área da cidade é composta por florestas, parques, jardins, rios e lagos.Documentada pela primeira vez no século XIII, Berlim foi sucessivamente a capital do Reino da Prússia (1701-1918), do Império Alemão (1871-1918), da República de Weimar (1919-1933) e do Terceiro Reich (1933-1945). Após a Segunda Guerra Mundial, a cidade foi dividida; Berlim Oriental se tornou a capital da Alemanha Oriental, enquanto Berlim Ocidental se tornou um exclave da Alemanha Ocidental, cercada pelo muro de Berlim, entre os anos de 1961-1989, enquanto a cidade de Bona tornou-se a capital da Alemanha Ocidental. Após a reunificação alemã em 1990, a cidade recuperou o seu estatuto, como a capital da República Federal da Alemanha, sediando 147 embaixadas estrangeiras.Berlim é uma cidade global e um dos mais influentes centros mundiais de cultura, política, mídia e ciência. Sua economia é baseada principalmente no setor de serviços, abrangendo uma variada gama de indústrias criativas, as corporações de mídia e locais de convenções. Berlim também serve como um hub continental para o transporte aéreo e ferroviário, e é um destino turístico popular. As indústrias significativas incluem TI, farmacêuticas, engenharia biomédica, biotecnologia, eletrônica, engenharia de tráfego e energia renovável.A cidade serve como um importante centro do transporte continental e é a sede de algumas das mais importantes universidades, eventos esportivos, orquestras e museus. O rápido desenvolvimento da metrópole atraiu uma reputação internacional aos seus festivais, arquitectura contemporânea e vida nocturna, sendo um grande centro turístico e moradia para pessoas de 180 nações diferentes."@pt .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin – stolica, siedziba rządu Republiki Federalnej Niemiec. Największe miasto Niemiec, na prawach kraju związkowego. Zajmuje powierzchnię ok. 892 km², zamieszkuje je 3,4 mln osób. Jest trzecim największym (po Londynie i Paryżu) miastem w Unii Europejskiej.Berlin jest podzielony na dwanaście okręgów administracyjnych (Bezirk). Przez przestrzeń miejską przepływają m.in. rzeki Sprewa i Hawela, a ponadto znajduje się wiele jezior i zatok, w tym największe Müggelsee.Pierwsza wzmianka o mieście pochodzi z 1237. Berlin pełnił rolę historycznej stolicy Brandenburgii, Prus, Cesarstwa Niemieckiego, Republiki Weimarskiej i III Rzeszy. Po 1945 roku wschodnia część miasta była stolicą Niemieckiej Republiki Demokratycznej, natomiast pozostała tworzyła Berlin Zachodni – otoczona murem (od 1961 r.) enklawa na terenie NRD. Po zjednoczeniu Niemiec w 1990 roku Berlin został ponownie stolicą Niemiec, siedzibą prezydenta (od 1994 roku), niemieckiego Bundestagu (od 1999 roku) i Bundesratu (od 2000 roku).Berlin jest jedną z ważniejszych w Europie metropolii globalnych, ponadto ważnym węzłem komunikacyjnym Niemiec i Europy, zarówno kolejowym, lotniczym i drogowym. Ważny ośrodek naukowy, kulturalny i artystyczny (m.in. Kulturforum i Museumsinsel)."@pl .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "柏林（德语：Berlin，德语发音：[bɛɐ̯ˈliːn]（13px 发音））是德国首都，也是德国最大的城市，现有居民约340万人。柏林位于德国东北部，四面被勃兰登堡州环绕，施普雷河和哈弗尔河流经该市。柏林也是德国十六个联邦州之一，和汉堡、不来梅同为德国僅有的三個的城市州。柏林是欧盟區內人口第3多的城市（歐盟區人口最多的都市是法國的巴黎，其次是英國的倫敦）以及城市面积第8大的城市。它是柏林－勃兰登堡都会区的中心，有来自超过190个国家的5百万人口。地理上位于欧洲平原，受温带季节性气候影响。城市周围三分之一的土地由森林、公园、花园、河流和湖泊组成。该市第一次有文字记载是在13世纪，柏林连续的成为以下这些国家的首都：普鲁士王国（1701年－1870年）、德意志帝国（1871年－1918年）、魏玛共和国（1919年－1933年）、納粹德國（1933年－1945年）。在1920年代，柏林是世界第3大自治市。第二次世界大战后，城市被分割；东柏林成为了东德的首都，而西柏林事实上成为了西德在东德的一块飛地，被柏林墙围住。直到1990年两德统一，该市重新获得了全德国首都的地位，驻有147个外国大使馆。柏林无论是从文化、政治、传媒还是科学上讲都称的上是世界级城市。该市经济主要基于服务业，包括多种多样的创造性产业、传媒集团、议会举办地点。柏林扮演了一个欧洲大陆上航空与铁路运输交通枢纽的角色，同时它也是欧盟内游客数量最多的城市之一。主要的产业包括信息技术、制药、生物工程、生物科技、光学电子、交通工程和可再生能源。柏林都会区有知名大学、研究院、体育赛事、管弦乐队、博物馆和知名人士。城市的历史遗存使该市成为国际电影产品的交流中心。该市在节日活动、建筑的多样化、夜生活、当代艺术、公共交通网络以及高质量生活方面得到了广泛认可。柏林已经发展成一个全球焦点城市，以崇尚自由生活方式和现代精神的年轻人和艺术家而闻名。"@zh .
