        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (prononc\uFFFD\uFFFD [b\uFFFD\uFFFD\uFFFD\uFFFD.l\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD] ; en allemand Berlin [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD.\uFFFD\uFFFDli\uFFFD\uFFFDn\uFFFD\uFFFD\uFFFD] ) est la capitale et la plus grande ville d'Allemagne. Situ\uFFFD\uFFFDe dans le nord-est du pays, elle forme un land (\uFFFD\uFFFDtat f\uFFFD\uFFFDd\uFFFD\uFFFDr\uFFFD\uFFFD) \uFFFD\uFFFD part enti\uFFFD\uFFFDre et compte environ 3,5 millions d'habitants. Ses habitants s'appellent les Berlinois. Berlin est la deuxi\uFFFD\uFFFDme ville, la cinqui\uFFFD\uFFFDme agglom\uFFFD\uFFFDration et la cinqui\uFFFD\uFFFDme zone urbaine \uFFFD\uFFFDlargie (apr\uFFFD\uFFFDs la r\uFFFD\uFFFDgion allemande de la Ruhr) la plus peupl\uFFFD\uFFFDe de l'Union europ\uFFFD\uFFFDenne. Son agglom\uFFFD\uFFFDration s'\uFFFD\uFFFDtend sur 2 284 km2 et compte un peu plus de 4 millions d'habitants, sa zone urbaine \uFFFD\uFFFDlargie 5 025 272 habitants et son aire urbaine qui cumule les L\uFFFD\uFFFDnder de Berlin et de Brandebourg regroupe au total pr\uFFFD\uFFFDs de 6 millions d'habitants. Fond\uFFFD\uFFFDe au XIIIe si\uFFFD\uFFFDcle, Berlin a \uFFFD\uFFFDt\uFFFD\uFFFD successivement capitale du royaume de Prusse (1701-1871), de l'Empire allemand (1871-1918), de la R\uFFFD\uFFFDpublique de Weimar (1919-1933) et du Troisi\uFFFD\uFFFDme Reich (1933-1945). Apr\uFFFD\uFFFDs 1945 et jusqu'\uFFFD\uFFFD la chute du Mur de Berlin en 1989, la ville est partag\uFFFD\uFFFDe en quatre secteurs d'occupation. Pendant la Guerre froide, le secteur sovi\uFFFD\uFFFDtique de la ville, nomm\uFFFD\uFFFD Berlin-Est, est devenu la capitale de la R\uFFFD\uFFFDpublique d\uFFFD\uFFFDmocratique allemande, tandis que Berlin-Ouest \uFFFD\uFFFDtait politiquement rattach\uFFFD\uFFFDe \uFFFD\uFFFD la R\uFFFD\uFFFDpublique f\uFFFD\uFFFDd\uFFFD\uFFFDrale d'Allemagne, devenant ainsi un bastion avanc\uFFFD\uFFFD du \uFFFD\uFFFD Monde libre \uFFFD\uFFFD \uFFFD\uFFFD l'int\uFFFD\uFFFDrieur du Bloc communiste. Apr\uFFFD\uFFFDs la chute du mur, Berlin redevint, en 1990, la capitale de l'Allemagne alors r\uFFFD\uFFFDunifi\uFFFD\uFFFDe, et les principales institutions f\uFFFD\uFFFDd\uFFFD\uFFFDrales y emm\uFFFD\uFFFDnag\uFFFD\uFFFDrent en 1999.Berlin est une ville mondiale culturelle et artistique de premier plan. La ville abrite 166 mus\uFFFD\uFFFDes, 142 biblioth\uFFFD\uFFFDques et 60 th\uFFFD\uFFFD\uFFFD\uFFFDtres. En 2012, Berlin a accueilli plus de 10,8 millions de visiteurs."@fr .
