        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin \uFFFD\uFFFD\uFFFD stolica, siedziba rz\uFFFD\uFFFDdu Republiki Federalnej Niemiec. Najwi\uFFFD\uFFFDksze miasto Niemiec, na prawach kraju zwi\uFFFD\uFFFDzkowego. Zajmuje powierzchni\uFFFD\uFFFD ok. 892 km\uFFFD\uFFFD, zamieszkuje je 3,4 mln os\uFFFD\uFFFDb. Jest trzecim najwi\uFFFD\uFFFDkszym (po Londynie i Pary\uFFFD\uFFFDu) miastem w Unii Europejskiej.Berlin jest podzielony na dwana\uFFFD\uFFFDcie okr\uFFFD\uFFFDg\uFFFD\uFFFDw administracyjnych (Bezirk). Przez przestrze\uFFFD\uFFFD miejsk\uFFFD\uFFFD przep\uFFFD\uFFFDywaj\uFFFD\uFFFD m.in. rzeki Sprewa i Hawela, a ponadto znajduje si\uFFFD\uFFFD wiele jezior i zatok, w tym najwi\uFFFD\uFFFDksze M\uFFFD\uFFFDggelsee.Pierwsza wzmianka o mie\uFFFD\uFFFDcie pochodzi z 1237. Berlin pe\uFFFD\uFFFDni\uFFFD\uFFFD rol\uFFFD\uFFFD historycznej stolicy Brandenburgii, Prus, Cesarstwa Niemieckiego, Republiki Weimarskiej i III Rzeszy. Po 1945 roku wschodnia cz\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD miasta by\uFFFD\uFFFDa stolic\uFFFD\uFFFD Niemieckiej Republiki Demokratycznej, natomiast pozosta\uFFFD\uFFFDa tworzy\uFFFD\uFFFDa Berlin Zachodni \uFFFD\uFFFD\uFFFD otoczona murem (od 1961 r.) enklawa na terenie NRD. Po zjednoczeniu Niemiec w 1990 roku Berlin zosta\uFFFD\uFFFD ponownie stolic\uFFFD\uFFFD Niemiec, siedzib\uFFFD\uFFFD prezydenta (od 1994 roku), niemieckiego Bundestagu (od 1999 roku) i Bundesratu (od 2000 roku).Berlin jest jedn\uFFFD\uFFFD z wa\uFFFD\uFFFDniejszych w Europie metropolii globalnych, ponadto wa\uFFFD\uFFFDnym w\uFFFD\uFFFDz\uFFFD\uFFFDem komunikacyjnym Niemiec i Europy, zar\uFFFD\uFFFDwno kolejowym, lotniczym i drogowym. Wa\uFFFD\uFFFDny o\uFFFD\uFFFDrodek naukowy, kulturalny i artystyczny (m.in. Kulturforum i Museumsinsel)."@pl .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlino (in tedesco Berlin [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn], ) \uFFFD\uFFFD la maggiore citt\uFFFD\uFFFD e nel contempo un Bundesland della Germania, quindi una citt\uFFFD\uFFFD-stato. Capitale federale della Repubblica Federale di Germania e sede del suo governo, \uFFFD\uFFFD uno dei pi\uFFFD\uFFFD importanti centri politici, culturali, scientifici, fieristici e mediatici d'Europa e, dopo Londra, il secondo comune pi\uFFFD\uFFFD popoloso dell'Unione europea, con 3.419.623 abitanti. La regione metropolitana Berlino/Brandeburgo ha una superficie di 30.370 km\uFFFD\uFFFD ed una popolazione (2012) di 6.024.000 abitanti."@it .
