        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (12px [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn]?/i) ist die Hauptstadt und zugleich ein Land der Bundesrepublik Deutschland. Der Stadtstaat Berlin bildet eine Einheitsgemeinde und ist mit \uFFFD\uFFFDber 3,4 Millionen Einwohnern die bev\uFFFD\uFFFDlkerungsreichste und mit knapp 892 Quadratkilometern die fl\uFFFD\uFFFDchengr\uFFFD\uFFFD\uFFFD\uFFFDte Kommune Deutschlands sowie nach Einwohnern die zweitgr\uFFFD\uFFFD\uFFFD\uFFFDte der Europ\uFFFD\uFFFDischen Union. Zudem ist Berlin mit rund 3800 Einwohnern je Quadratkilometer die am drittdichtesten bev\uFFFD\uFFFDlkerte Gemeinde Deutschlands. Berlin ist eine Enklave im Land Brandenburg und bildet das Zentrum der Metropolregion Berlin/Brandenburg (6 Millionen Einwohner) sowie der Agglomeration Berlin (4,4 Millionen Einwohner). Der Stadtstaat unterteilt sich in zw\uFFFD\uFFFDlf Bezirke. Neben den Fl\uFFFD\uFFFDssen Spree, Havel und Dahme befinden sich im Stadtgebiet kleinere Flie\uFFFD\uFFFDgew\uFFFD\uFFFDsser sowie zahlreiche Seen und W\uFFFD\uFFFDlder.Erstmals 1237 urkundlich erw\uFFFD\uFFFDhnt, war Berlin im Verlauf der Geschichte und in verschiedenen Staatsformen Residenz- und Hauptstadt Brandenburgs, Preu\uFFFD\uFFFDens und des Deutschen Reichs. Ab 1949 war der Ostteil der Stadt faktisch Hauptstadt der Deutschen Demokratischen Republik. Mit der deutschen Wiedervereinigung im Jahr 1990 war Berlin wieder gesamtdeutsche Hauptstadt und wurde in der Folge Sitz der Bundesregierung, des Bundespr\uFFFD\uFFFDsidenten, des Deutschen Bundestags, des Bundesrats sowie zahlreicher Bundesministerien und Botschaften.Berlin ist ein bedeutender europ\uFFFD\uFFFDischer Verkehrsknotenpunkt und eines der meistbesuchten Zentren des Kontinents. Die Sportereignisse, Universit\uFFFD\uFFFDten, Forschungseinrichtungen und Museen Berlins genie\uFFFD\uFFFDen internationalen Ruf. In der Stadt leben Firmengr\uFFFD\uFFFDnder, K\uFFFD\uFFFDnstler und Einwanderer aus aller Welt. Berlins Architektur, Festivals, Nachtleben und vielf\uFFFD\uFFFDltige Lebensbedingungen sind weltweit bekannt."@de .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlim (em alem\uFFFD\uFFFDo Berlin) \uFFFD\uFFFD a capital e um dos dezesseis estados da Alemanha. Com uma popula\uFFFD\uFFFD\uFFFD\uFFFDo de 3,5 milh\uFFFD\uFFFDes dentro de limites da cidade, \uFFFD\uFFFD a maior cidade do pa\uFFFD\uFFFDs, al\uFFFD\uFFFDm de ser a segunda mais populosa cidade e a s\uFFFD\uFFFDtima \uFFFD\uFFFDrea urbana mais populosa da Uni\uFFFD\uFFFDo Europeia. Situada no nordeste da Alemanha, \uFFFD\uFFFD o centro da \uFFFD\uFFFDrea metropolitana de Berlim-Brandemburgo, que inclui 5 milh\uFFFD\uFFFDes de pessoas de mais de 190 na\uFFFD\uFFFD\uFFFD\uFFFDes. Localizada na grande plan\uFFFD\uFFFDcie europeia, Berlim \uFFFD\uFFFD influenciada por um clima temperado sazonal. Cerca de um ter\uFFFD\uFFFDo da \uFFFD\uFFFDrea da cidade \uFFFD\uFFFD composta por florestas, parques, jardins, rios e lagos.Documentada pela primeira vez no s\uFFFD\uFFFDculo XIII, Berlim foi sucessivamente a capital do Reino da Pr\uFFFD\uFFFDssia (1701-1918), do Imp\uFFFD\uFFFDrio Alem\uFFFD\uFFFDo (1871-1918), da Rep\uFFFD\uFFFDblica de Weimar (1919-1933) e do Terceiro Reich (1933-1945). Ap\uFFFD\uFFFDs a Segunda Guerra Mundial, a cidade foi dividida; Berlim Oriental se tornou a capital da Alemanha Oriental, enquanto Berlim Ocidental se tornou um exclave da Alemanha Ocidental, cercada pelo muro de Berlim, entre os anos de 1961-1989, enquanto a cidade de Bona tornou-se a capital da Alemanha Ocidental. Ap\uFFFD\uFFFDs a reunifica\uFFFD\uFFFD\uFFFD\uFFFDo alem\uFFFD\uFFFD em 1990, a cidade recuperou o seu estatuto, como a capital da Rep\uFFFD\uFFFDblica Federal da Alemanha, sediando 147 embaixadas estrangeiras.Berlim \uFFFD\uFFFD uma cidade global e um dos mais influentes centros mundiais de cultura, pol\uFFFD\uFFFDtica, m\uFFFD\uFFFDdia e ci\uFFFD\uFFFDncia. Sua economia \uFFFD\uFFFD baseada principalmente no setor de servi\uFFFD\uFFFDos, abrangendo uma variada gama de ind\uFFFD\uFFFDstrias criativas, as corpora\uFFFD\uFFFD\uFFFD\uFFFDes de m\uFFFD\uFFFDdia e locais de conven\uFFFD\uFFFD\uFFFD\uFFFDes. Berlim tamb\uFFFD\uFFFDm serve como um hub continental para o transporte a\uFFFD\uFFFDreo e ferrovi\uFFFD\uFFFDrio, e \uFFFD\uFFFD um destino tur\uFFFD\uFFFDstico popular. As ind\uFFFD\uFFFDstrias significativas incluem TI, farmac\uFFFD\uFFFDuticas, engenharia biom\uFFFD\uFFFDdica, biotecnologia, eletr\uFFFD\uFFFDnica, engenharia de tr\uFFFD\uFFFDfego e energia renov\uFFFD\uFFFDvel.A cidade serve como um importante centro do transporte continental e \uFFFD\uFFFD a sede de algumas das mais importantes universidades, eventos esportivos, orquestras e museus. O r\uFFFD\uFFFDpido desenvolvimento da metr\uFFFD\uFFFDpole atraiu uma reputa\uFFFD\uFFFD\uFFFD\uFFFDo internacional aos seus festivais, arquitectura contempor\uFFFD\uFFFDnea e vida nocturna, sendo um grande centro tur\uFFFD\uFFFDstico e moradia para pessoas de 180 na\uFFFD\uFFFD\uFFFD\uFFFDes diferentes."@pt .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berl\uFFFD\uFFFDn (Berlin en alem\uFFFD\uFFFDn (Acerca de este sonido [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn] )) es la capital de Alemania y uno de los diecis\uFFFD\uFFFDis estados federados alemanes. Se localiza al noreste de Alemania, a escasos 70 km de la frontera con Polonia. Por la ciudad fluyen los r\uFFFD\uFFFDos Spree, Havel, Panke, Dahme y Wuhle. Con una poblaci\uFFFD\uFFFDn de 3,4 millones de habitantes, Berl\uFFFD\uFFFDn es la ciudad m\uFFFD\uFFFDs poblada del pa\uFFFD\uFFFDs, as\uFFFD\uFFFD como la segunda ciudad en tama\uFFFD\uFFFDo y la quinta aglomeraci\uFFFD\uFFFDn urbana entre los pa\uFFFD\uFFFDses de la Uni\uFFFD\uFFFDn Europea.Fundada en 1237 como C\uFFFD\uFFFDlln, Berl\uFFFD\uFFFDn fue sucesivamente capital del Reino de Prusia (1701-1918), de la Rep\uFFFD\uFFFDblica de Weimar (1919\uFFFD\uFFFD\uFFFD1933) y del Tercer Reich (1933\uFFFD\uFFFD\uFFFD1945). Despu\uFFFD\uFFFDs de la Segunda Guerra Mundial, la ciudad fue dividida; la parte este de la ciudad se convirti\uFFFD\uFFFD en la capital de la Rep\uFFFD\uFFFDblica Democr\uFFFD\uFFFDtica Alemana, mientras que la regi\uFFFD\uFFFDn oeste de la ciudad se convirti\uFFFD\uFFFD en un enclave de la Rep\uFFFD\uFFFDblica Federal de Alemania en el interior de la Alemania Oriental.Berl\uFFFD\uFFFDn es una ciudad mundial y un centro cultural y art\uFFFD\uFFFDstico de primer nivel. Es una de las ciudades m\uFFFD\uFFFDs influyentes en el \uFFFD\uFFFDmbito pol\uFFFD\uFFFDtico de la Uni\uFFFD\uFFFDn Europea y en 2006 fue elegida Ciudad Creativa por la Unesco. En 2009 la ciudad recibi\uFFFD\uFFFD el Premio Pr\uFFFD\uFFFDncipe de Asturias de la Concordia."@es .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlin (/b\uFFFD\uFFFDr\uFFFD\uFFFDl\uFFFD\uFFFDn/, German: [b\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFDli\uFFFD\uFFFDn] (13px )) is the capital of Germany, and one of the 16 states of Germany. With a population of 3.5 million people, Berlin is Germany's largest city. It is the second most populous city proper and the seventh most populous urban area in the European Union. Located in northeastern Germany on the banks of River Spree, it is the center of the Berlin-Brandenburg Metropolitan Region, which has about 4.5 million residents from over 180 nations. Due to its location in the European Plain, Berlin is influenced by a temperate seasonal climate. Around one third of the city's area is composed of forests, parks, gardens, rivers and lakes.First documented in the 13th century, Berlin became the capital of the Margraviate of Brandenburg (1417), the Kingdom of Prussia (1701\uFFFD\uFFFD\uFFFD1918), the German Empire (1871\uFFFD\uFFFD\uFFFD1918), the Weimar Republic (1919\uFFFD\uFFFD\uFFFD1933) and the Third Reich (1933\uFFFD\uFFFD\uFFFD1945). Berlin in the 1920s was the third largest municipality in the world. After World War II, the city was divided; East Berlin became the capital of East Germany while West Berlin became a de facto West German exclave, surrounded by the Berlin Wall (1961\uFFFD\uFFFD\uFFFD1989). Following German reunification in 1990, the city was once more designated as the capital of all Germany, hosting 158 foreign embassies.Berlin is a world city of culture, politics, media, and science. Its economy is based on high-tech firms and the service sector, encompassing a diverse range of creative industries, research facilities, media corporations, and convention venues. Berlin serves as a continental hub for air and rail traffic and has a highly complex public transportation network. The metropolis is a popular tourist destination. Significant industries also include IT, pharmaceuticals, biomedical engineering, clean tech, biotechnology, construction, and electronics.Modern Berlin is home to renowned universities, orchestras, museums, entertainment venues, and is host to many sporting events. Its urban setting has made it a sought-after location for international film productions. The city is well known for its festivals, diverse architecture, nightlife, contemporary arts, and a high quality of living. Over the last decade Berlin has seen the upcoming of a cosmopolitan entrepreneurial scene."@en .
        <http://dbpedia.org/resource/Berlin> <http://dbpedia.org/ontology/abstract> "Berlijn (Duits: Berlin) is de hoofdstad van Duitsland en als stadstaat een deelstaat van dat land. Met 3.375.222 inwoners is Berlijn tevens de grootste stad van het land en de op \uFFFD\uFFFD\uFFFD\uFFFDn na grootste stad in de Europese Unie. De stad ligt in het noordoosten van Duitsland, aan de rivier de Spree en wordt omsloten door de deelstaat Brandenburg, waarvan ze sinds 1920 geen deel meer uitmaakt.In zijn geschiedenis, die teruggaat tot de dertiende eeuw, was Berlijn de hoofdstad van Pruisen (1701\uFFFD\uFFFD\uFFFD1918), het Duitse Keizerrijk (1871\uFFFD\uFFFD\uFFFD1918), de Weimarrepubliek (1919\uFFFD\uFFFD\uFFFD1933) en nazi-Duitsland (1933\uFFFD\uFFFD\uFFFD1945). Na de Tweede Wereldoorlog was Berlijn gedurende meer dan veertig jaar een verdeelde stad, waarbij het oostelijke deel als hoofdstad fungeerde van de Duitse Democratische Republiek en West-Berlijn een de facto exclave van West-Duitsland was. Na de Duitse hereniging in 1990 werd Berlijn de hoofdstad van de Bondsrepubliek Duitsland en de zetel van het parlement, de deelstaatvertegenwoordiging en het staatshoofd.Berlijn is een metropool en geldt in Europa als een van de grootste culturele, politieke en wetenschappelijke centra. De stad is ook bekend vanwege het hoog-ontwikkelde culturele leven (festivals, nachtleven, musea, kunsttentoonstellingen enz.) en de liberale levensstijl, moderne Zeitgeist en de lage kosten. Bovendien is Berlijn een van de groenste steden van Europa: 22% van Berlijn bestaat uit natuur en parken en 6% uit meren, rivieren en kanalen."@nl .
